function usersubmitForm(){var c=$("#phone_add").val();var f=$("#phone_add").val();var i=$("#password_add").val();var e=$("#repassword").val();var d=$("#rolelist").combobox("getValue");var h=$("#address_add").val();var g=$("#realname_add").val();var b=$("#orgname_add").val();if(c==""||f==""){$.messager.alert("提示","手机号不能为空!");return}if(i.length<5&&i.length>32){$.messager.alert("提示","密码长度大于5小于32!");return}if(e.length<5&&e.length>32){$.messager.alert("提示","确认密码长度大于5小于32!");return}if(e!=i){$.messager.alert("提示","密码和确认密码不相等!");return}if(g==""){$.messager.alert("提示","真实姓名不能为空!");return}if(d==""){$.messager.alert("提示","角色不能为空!");return}var a={"username":c,"phone":f,"password":i,"roleId":d,"address":h,"realname":g,"orgname":b};console.log(a);$.ajax({url:ws_url+"/rest/user/insertUser?token="+gtoken,contentType:"application/json;charset=UTF-8",type:"post",datatype:"json",data:JSON.stringify(a),cache:false,success:function(j){console.log(j.status);console.log(j.message);$("#form1").form("clear");if(j.status=="success"){$.messager.alert("提示","添加成功！","info",function(){$("#useradd").window("close");$("#usergrid").datagrid("reload")})}else{if(j.status=="failure"){if(j.message=="USER_EXIST_SUCCESS"){$.messager.alert("提示","数据已经存在,添加失败！","warning",function(){$("#useradd").window("close");$("#usergrid").datagrid("reload")})}else{$.messager.alert("提示","添加失败！","error",function(){$("#useradd").window("close");$("#usergrid").datagrid("reload")})}}}},error:function(j){console.log(j)}})};